import React from 'react'
import { Link } from 'react-router-dom'

export const Header = () => {
  return (
    <div className='w-full flex justify-between items-center p-5 bg-indigo-50 shadow-xl'>
        <Link to={'/'}></Link>
        <div className='nav-items'>
            <span></span>
        </div>
    </div>
  )
}
